export default (function(a,b,c,d,e,f,g,h){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},IUTAZWrre7:{data:{id:1385,attributes:{imdbId:"tt5580266",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZDVkMWJiMzUtNjQyOS00MGVmLWJhYmMtN2IxYzU4MjY3MDRmXkEyXkFqcGdeQXVyNzA5NjIzODk@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"7.5\u002F10"},{Source:"Rotten Tomatoes",Value:"97%"},{Source:"Metacritic",Value:"81\u002F100"}],item_lang:{data:{id:2048,attributes:{title:e,plot:"Starr Carter is constantly switching between two worlds: the poor, mostly black, neighborhood where she lives and the rich, mostly white, prep school she attends. The uneasy balance between these worlds is shattered when Starr witnesses the fatal shooting of her childhood best friend Khalil at the hands of a police officer. Now, facing pressures from all sides of the community, Starr must find her voice and stand up for what's right.",slug:"the-hate-u-give"}}},books:{data:[{id:7458,attributes:{title:e,description:"8 starred reviews · Goodreads Choice Awards Best of the Best · William C. Morris Award Winner · National Book Award Longlist · Printz Honor Book · Coretta Scott King Honor Book · #1 New York Times Bestseller! \"Absolutely riveting!\" —Jason Reynolds \"Stunning.\" —John Green \"This story is necessary. This story is important.\" —Kirkus (starred review) \"Heartbreakingly topical.\" —Publishers Weekly (starred review) \"A marvel of verisimilitude.\" —Booklist (starred review) \"A powerful, in-your-face novel.\" —Horn Book (starred review) Sixteen-year-old Starr Carter moves between two worlds: the poor neighborhood where she lives and the fancy suburban prep school she attends. The uneasy balance between these worlds is shattered when Starr witnesses the fatal shooting of her childhood best friend Khalil at the hands of a police officer. Khalil was unarmed. Soon afterward, his death is a national headline. Some are calling him a thug, maybe even a drug dealer and a gangbanger. Protesters are taking to the streets in Khalil’s name. Some cops and the local drug lord try to intimidate Starr and her family. What everyone wants to know is: what really went down that night? And the only person alive who can answer that is Starr. But what Starr does—or does not—say could upend her community. It could also endanger her life. Want more of Garden Heights? Catch Maverick and Seven’s story in Concrete Rose, Angie Thomas's powerful prequel to The Hate U Give.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=OTwYDQAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2017-02-28",publisher:"HarperCollins",subtitle:a}},{id:7459,attributes:{title:"Angie Thomas 2-Book Box Set",description:"Discover the critically acclaimed, #1 New York Times bestselling The Hate U Give and the highly anticipated On the Come Up from Angie Thomas in this hardcover box set. FIND YOUR VOICE. MAKE SOME NOISE. The Hate U Give William C. Morris Award Winner ∙ National Book Award Longlist ∙ Michael L. Printz Honor Book ∙ Coretta Scott King Author Honor Book \"Absolutely riveting!\" —Jason Reynolds \"Stunning.\" —John Green \"This story is necessary. This story is important.\"—Kirkus (starred review) \"Heartbreakingly topical.\"—Publishers Weekly (starred review) Sixteen-year-old Starr Carter moves between two worlds: the poor neighborhood where she lives and the fancy suburban prep school she attends. The uneasy balance between these worlds is shattered when Starr witnesses the fatal shooting of her childhood best friend Khalil at the hands of a police officer. On the Come Up Sixteen-year-old Bri wants to be one of the greatest rappers of all time. Or at least win her first battle. As the daughter of an underground hip hop legend who died right before he hit big, Bri’s got massive shoes to fill. But it’s hard to get your come up when you’re labeled a hoodlum at school, and your fridge at home is empty after your mom loses her job. So Bri pours her anger and frustration into her first song, which goes viral…for all the wrong reasons.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=Zte7uAEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2019-03-05",publisher:h,subtitle:"The Hate U Give and On the Come Up"}},{id:7460,attributes:{title:"The Hate U Give Movie Tie-in Edition",description:"The acclaimed, award-winning novel is now a major motion picture starring Amandla Stenberg, Russell Hornsby, Regina Hall, Anthony Mackie, Issa Rae, and Common. This edition features the movie poster art, full-color photos, and Angie Thomas in conversation with Amandla Stenberg and director George Tillman Jr. 8 starred reviews ∙ William C. Morris Award Winner ∙ National Book Award Longlist ∙ Printz Honor Book ∙ Coretta Scott King Honor Book ∙ #1 New York Times Bestseller (60+ weeks on the list!) \"Absolutely riveting!\" —Jason Reynolds \"Stunning.\" —John Green \"This story is necessary. This story is important.\" —Kirkus (starred review) \"Heartbreakingly topical.\" —Publishers Weekly (starred review) \"A marvel of verisimilitude.\" —Booklist (starred review) \"A powerful, in-your-face novel.\" —Horn Book (starred review) Sixteen-year-old Starr Carter moves between two worlds: the poor neighborhood where she lives and the fancy suburban prep school she attends. The uneasy balance between these worlds is shattered when Starr witnesses the fatal shooting of her childhood best friend Khalil at the hands of a police officer. Khalil was unarmed. Soon afterward, his death is a national headline. Some are calling him a thug, maybe even a drug dealer and a gangbanger. Protesters are taking to the streets in Khalil’s name. Some cops and the local drug lord try to intimidate Starr and her family. What everyone wants to know is: what really went down that night? And the only person alive who can answer that is Starr. But what Starr does—or does not—say could upend her community. It could also endanger her life. And don't miss On the Come Up, Angie Thomas's powerful follow-up to The Hate U Give.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=BwDSswEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2018-09-04",publisher:h,subtitle:a}},{id:7461,attributes:{title:e,description:a,thumbnail:a,authors:[b],firstBook:d,published:"2018-12-26",publisher:a,subtitle:"Der Roman zum Film"}},{id:7462,attributes:{title:"Angie Thomas Carter Family 2-Book Box Set",description:a,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=GdZYzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2021-10-26",publisher:"Balzer & Bray",subtitle:"The Hate U Give, Concrete Rose"}}]}}},meta:{}}},prerenderedAt:1681377337681}}("","Angie Thomas","movie",null,"The Hate U Give","series",1,"Balzer + Bray"))